INSERT INTO `blogs` (`id`, `title`, `slug`, `subtitle`, `coverImage`, `tags`, `creator`, `writer`, `description1`, `description2`, `status`, `deleteId`, `created_at`, `updated_at`) VALUES
(1, 'Some Like It Healthy', 'some-like-it-healthy', 'You Are What You Eat', 'media/images/blog/1672496328IMG_8615.jpg', 'test,blog,food,foodexpert,foodtechnologist,dietmeals,healthymeals,customizedmealsdelivery,nutritious,healthymeals,tastyhomemademeals,doorstepdelivery,highproteinmeals,highproteincustomizedmeals', 'Piyush', 'Poonam Kapur', '<p><img src=\"data:image/png;base64,\" style=\"width: 692px;\" data-filename=\"image.png\"><br></p>', '<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\">YOU ARE WHAT YOU EAT AND DRINK<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\">You have always heard of You Are What You Eat but we have added drinks also here as we as Food experts understand the importance of hydrating your body with drinks that are not only tasty but healthy also.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\">Now I am sure you must be aware that healthy drinks are drinks with lesser or no sugar but are you aware that there are many other ingredients, which make your drinks very unhealthy?  So today we shall discuss drinks one by one and try to understand which one is the best for us.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\">In every blog, we shall talk about one drink and try to analyze its constitution and a few claims that these food industries make. By the way, I am also a food technologist by profession and can certainly take you through these varied drinks which keep attracting you from shelves of superstores.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\">HOW TO READ LABELS SMARTLY<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\">Start analyzing the labels.  Reading the labels and understanding what’s not written is something we all should understand.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0); text-indent: -18pt;\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span>Serving size: you picked up a can and very wisely checked the no of cal written, just recheck if it\'s written per serving or per can. They would very smartly make you feel good that it has 65 cal/serving and their serving size can vary like my serving size is 2/3 cup and your serving size might be ½ cup so just imagine it\'s not only about serving size but it\'s about the company’s serving size.<o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\">So next time whenever you read labels be careful with the serving size.<o:p></o:p></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p><span style=\"color: rgb(0, 0, 0); font-size: 12pt; font-family: Cambria;\">2          Do not let the healthy claims fool you:  No added sugar but ingredients would show HFCS that is high fructose corn syrup. So is it bad for you? Yes by all means it\'s bad for your health as it is used in the majority of foods without calling much attention. Even low-fat foods have HFCS to make up for the lost flavor. HFCS  like all sugars is nutrient empty and very high in calories. It leads to glycemic problems which is not good for diabetics. So consider avoiding</span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\">3.  Read 1<sup>st</sup> Three ingredients with utmost care as it will give you a fair idea of what your drinks or foods have in maximum.  Just see the number in the list and understand how good is it for you.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\">We will discuss more facts about understanding labels and move on to understanding different foods, diets, and fads.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0);\"><o:p> </o:p></p>', 1, 0, '2022-12-29 06:58:49', '2023-01-10 14:10:10');
