(1, 'SALAD', 'media/images/category/167093807845c61afc-514a-4309-bf5e-a3be13a428d1.jpg', 'The variety of salads is served with healthy dressings that are prepared in-house. These are used to curate combos for low-cal meals for all categories like weight loss, diabetic-friendly, PCOD friendly and gluten-free meals', 'Order best and healthy Salads from Poonam Kapur’s Healthy Kitchen', 'healthy sandwich, healthy sandwiches for weight loss, nutritious sandwich, sandwich good for health.healthy diet, healthy meal plans, healthy diet plans, healthy meal, healthy salad, diet meal plan, healthy meal subscription, healthy meal plans for weight loss, salad vegan recipes, balanced meal.', 'Poonmakapur has the healthy, nutritious and tasty salads to offer. Order online and get amazing offers freshly cooked salad delivered at your doorstep.', 1, 0, '2022-10-03 02:52:37', '2022-12-13 20:27:58'),
(2, 'SANDWICHES', 'media/images/category/1670939347cb09cd70-3b08-4355-b304-a8d46a329074.jpg', 'The sandwiches prepared are healthy, made of high protein bread and zero maida.', 'Taste the Best Healthy Sandwiches in Andheri West, Mumbai', 'healthy sandwich, healthy sandwiches for weight loss, nutritious sandwich, sandwich good for health.', 'Experience the ultimate sandwich experience. Explore the best places to eat sandwiches. From classic to modern sandwiches, there\'s something for everyone.', 1, 0, '2022-10-03 02:52:49', '2022-12-13 20:49:07'),
(3, 'LOW CALORIES MEALS', 'media/images/category/1670939485fullsizeoutput_42.jpeg', 'Low-cal meals are calorie-counted meals used to curate combos in Weight Loss, Diabetic friendly, PCOD and gluten-free meals', 'Healthy Low Calorie Meals | Poonamkapur', 'low calorie foods, low calorie diet, 0 calorie foods, low calorie food for weight loss, less calorie food, low calorie foods, weight loss recipes, diet recipes, less calorie food, recipes healthy.', 'Find Healthy, Delicious Low Calorie Meals including Low Calorie breakfast, Lunch, Dinner and Snacks from the Food and Nutrition expert Poonamkapur.', 1, 0, '2022-10-03 02:53:17', '2022-12-13 20:51:25'),
(4, 'MEDIUM CALORIE MEALS', 'media/images/category/16709396178e7c9b18-1e11-453e-9d72-d06f5b11c69d.jpg', 'Med cal meals are calorie counted filling healthy meals to maintain weight. These meals are high in proteins, has carbs and veggies.', 'Healthy Medium Calorie Meals | Poonamakpur', 'medium calorie meals, veg medium calorie, chicken medium calorie, vegan medium calorie, prawns medium calorie, fish medium calorie, glutenfree medium calorie, medium calorie foods.', 'you can enjoy Healthy Medium Calorie Meals, delivered right to you. The weekly food planner online allows you to customize.', 1, 0, '2022-10-03 02:53:34', '2022-12-13 20:53:37'),
(5, 'SOUPS', 'media/images/category/167093981267b52964-c4e8-4724-b2e6-1252dd7973e2.jpg', 'Soups are prepared fresh with vegetable puree every time you order. These soups have the goodness of vegetables without any artificial color or additive, not even corn flour.', 'Poonamkapur - Healthy Soups for Every Diet in Mumbai', 'soup and salad, veg soup, chicken soup, healthy soup recipes, healthy soup.', 'Looking for a healthy soup to make? We\'ve got delicious soups that fit every diet. Try out our healthy recipes to make your mealtime more nutritious.', 1, 0, '2022-10-03 02:53:53', '2022-12-13 20:56:52'),
(6, 'WRAPS', 'media/images/category/167093991618c34ede-0421-4e6f-8586-5642d1fabeec.jpg', 'The Wraps are prepared with whole wheat flour and stuffed with goodness of veggies and proteins mixed with inhouse prepared sauces.', 'Best & Healthy Wraps in Mumbai | Poonamkapur', 'shops near me, wraps near me, healthy wrap, , low calorie wraps, healthy chicken wrap recipes, veg wrap, fish wrap, prawns wrap.', 'Made from fresh ingredients & with a variety of flavors, our wraps are sure to satisfy your appetite. Try one today and experience the deliciousness for yourself.', 1, 0, '2022-10-03 02:54:19', '2022-12-13 20:58:36'),
(7, 'HIGH PROTEIN MEALS', 'media/images/category/16709401603f004a82-c647-44cc-9dcb-8c90bf5a5f58.jpg', 'High protein meals are loaded with complex carbs, good portions of quality proteins, good fat, veggies, beans, and in-house sauces made of different vegetables and herbs. Heavenly is delicious and very nutritious.', 'Healthy rich High Protein Meals | Poonamkapur', 'rich protein food, high protein foods, high protein meals, high protein low fat foods, high protein low calorie foods, best protein food, high protein foods for weight loss, protein rich food for weight loss, high rich protein food, weight loss protein food.', 'These High Protein Meals are perfect for those who want to boost their intake from time to time. Utilize foods with high protein for overall diet enhancement.', 1, 0, '2022-10-03 02:54:36', '2022-12-13 21:02:40'),
(8, 'COMBOS', 'media/images/category/1670940459271de86a-d580-42e6-9116-f2bb64fd0c2b.jpg', 'These combos are curated for weight loss, diabetic, pcod friendly meals. The combos are low in calorie and very healthy', 'best healthy combos for breakfast, lunch and dinner in Mumbai', 'Combos, veg combos, chicken combos, vegan combos, fish combos, vegan combos, healthy food combos, healthy combos, healthy meal combinations, best healthy food combinations.', 'We deliver delicious salad, sandwich, juice &  smoothie  combos to help you to get in shape. Healthy Combo Meals Online Order Service in Mumbai.', 1, 0, '2022-10-03 02:54:53', '2022-12-13 21:07:39'),
(9, 'INDIAN MEALS', 'media/images/category/1670940592Copy of DSC_0866.JPG', 'Your search for Ghar ka khana ends with these meals. Non-repetitive menu, lot of variety, non oily, medium spicy and  very tasty.', 'Best & healthy Indian meals Tiffin service in Mumbai', 'healthy food, diet foods, healthy meals, healthy foods to eat, eat healthy food, healthy diet foods, healthy food items, best healthy food, balance diet food, healthy and tasty food.', 'Serving Indian and healthy continental meals in both veg and Non veg variants. Customised meals are our best seller, pay only for what you eat.', 1, 0, '2022-10-03 02:55:10', '2022-12-13 21:09:52');
