INSERT INTO `faqs` (`id`, `question`, `answer`, `sequence`, `status`, `deleteId`, `created_at`, `updated_at`) VALUES
(2, 'Are the meals curated as per dietary requirements?', 'Yes, the combos have been designed considering different body discomforts in general. You can get a meal customized for you by our dietitian. just book an online appointment and take guidance.', 1, 1, 0, '2022-12-20 12:45:05', '2022-12-20 12:45:05'),
(3, 'How do i book a call for customized diet plan curation and what are the charges?', 'Go to the consultation tab on the home page and book an appointment on the calendar, all the details are mentioned there.', 2, 1, 0, '2022-12-20 12:46:55', '2022-12-20 12:46:55'),
(4, 'How are the meals delivered?', 'Meals are delivered through our delivery boys and dabbawalas in disposables. The packing used is of well-researched food-grade silver pouches as they are spill-proof, keep your food warm for at least 2-3 hours, are easily decomposable, and are easy to handle. You can request plastic containers with an additional amount of rs 15/meal.', 3, 1, 0, '2022-12-20 12:51:26', '2022-12-20 12:51:26'),
(5, 'where all do you deliver?', 'we deliver across Mumbai, still chek for your location by punching Pincode.', 4, 1, 0, '2022-12-20 12:53:01', '2022-12-20 12:53:01'),
(6, 'can i book a trial?', 'yes and post that you can opt for discounted packages', 4, 1, 0, '2022-12-20 12:53:32', '2022-12-20 12:53:32'),
(7, 'will the meals carry forward in case of cancellation?', 'yes the meals would get carried forward to the next delivery date.', 5, 1, 0, '2022-12-20 12:54:26', '2022-12-20 12:54:26'),
(8, 'what all combos do you serve?', 'we serve combos for weight loss, diabetics, pcod, gluten intolerant, muscle building, balanced indian meals', 2, 1, 0, '2022-12-20 12:58:48', '2022-12-20 12:58:48'),
(9, 'can i create my own plan for veg , non veg, indian or any other package?', 'yes while booking your meals in the cart choose different packages and dates one by one. in case of any doubt feel free to call us', 6, 1, 0, '2022-12-20 13:00:19', '2022-12-20 13:00:19'),
(10, 'is there any validity for the package?', 'yes 60 days for 30 meals, 90 days for 60 meals', 8, 1, 0, '2022-12-20 13:04:48', '2022-12-20 13:04:48'),
(11, 'do the meals have any side effects?', 'No, unless you are allergic to something specific that the meal has. In case of allergies kindly specify before placing the order.', 9, 1, 0, '2022-12-20 13:06:50', '2022-12-20 13:06:50'),
(12, 'Are the meals effective?', 'yes, the combos are designed by the food experts and lots of our customers have benefitted from the curated combos.', 10, 1, 0, '2022-12-20 13:07:56', '2022-12-20 13:07:56');
INSERT INTO `goals` (`id`, `name`, `image`, `description`, `status`, `deleteId`, `created_at`, `updated_at`) VALUES
(1, 'Weight Loss', 'media/images/goal/1672986079weightloss.png', 'Weight loss meal delivery at your doorstep. \r\nFIBRE RICH, NUTRITIOUS, LOW CALORIE, HIGH PROTEIN MEALS\r\n\r\nIf losing weight is your goal we can help you achieve that with our weight loss meals. These combos are just right in terms of Macronutrients and Micronutrients. \r\n\r\nA typical Indian diet has majorly simple carbs and sugars in the platter leading to the problem of weight gain.\r\n\r\nThese healthy meal combos constitute of low complex carbs, high proteins and low fat. We curate meals and display all the calorie values so that you can make informed decision about what and how much to eat.\r\n\r\nThese combos are high protein meals, which keep you full for a long time and lead to a healthier and stronger version of yourself. High protein vegetarian meals as well as high protein non-veg meal delivery services available with daily meal subscriptions. \r\n\r\nIn-short the meals are High in protein, low in carbs, have good fat loaded with seeds and served with in-house prepared sauces.', 1, 0, '2022-10-06 06:31:14', '2023-01-06 14:10:57'),
(2, 'Diabetic Friendly', 'media/images/goal/1672986096sugarfree.png', 'HIGH FIBRE, LOW GI, NON-SUGARY, NUTRITIOUS, HIGH PROTEIN MEALS\r\n\r\nThese healthy meal combos help in controlling sugar levels, these meals can also be customized after booking an appointment with our diet consultant. These meals help in controlling sugar levels and help you achieve your health goals.\r\n\r\nOrder diet food online and our customers have responded very well to these specially curated meals.\r\nDiabetic meals consist of low GI foods, complex carbs, good fats, high fiber, and high protein meals.\r\n \r\nThese curated meals help in controlling sugar levels. The combos are calorie counted and keep macros in check.', 1, 0, '2022-10-06 06:31:31', '2023-01-06 14:11:46'),
(3, 'Indian Balanced Meal', 'media/images/goal/1672986119nalanced.png', 'These meals are Indian meals, and both veg and non-veg options are available. The meals are balanced with carbs, fats and proteins.\r\n\r\nThese Indian meals are simple homemade meals \r\n\r\nThe healthy meals prepared have low oil, medium spicy, very simple, homemade, tasty and healthy meals.\r\nThe menu for these meals is prepared for the month and displayed on the website. You can also have healthy meal subscription or healthy Tiffin services for a month where the healthy meals are delivered at your doorsteps daily.\r\n\r\nMostly the menu remains as pre-decided, but it is subject to change due to unavoidable circumstances.', 1, 0, '2022-10-06 06:31:47', '2023-01-06 14:14:08'),
(4, 'PCOD Friendly', 'media/images/goal/1672986131pcodfriendly.png', 'These healthy customized meals are PCOD friendly as they are macro and micro counted high protein combos with meals specially designed to take care of women suffering with PCOD. \r\n\r\nLot of women today is suffering from PCOD so it’s important to address this issue with corrective meals.\r\n\r\nFor further customization book an appointment with our in-house dietitians and live a healthy life with healthy meal subscriptions.', 1, 0, '2022-10-06 06:32:03', '2023-01-06 14:12:11'),
(5, 'Muscle Building', 'media/images/goal/1672986142musclebuilding.png', 'These meals are helpful in bulking up muscles while reducing body’s fat percentage.\r\n\r\nThe meals are high in protein and sports persons and body builders curate combos considering high requirement of proteins. \r\n\r\nThe meals are very helpful in building body muscles, toning the body and make you feel better and stronger. Order diet food online for your daily diet routine just at your doorstep.\r\n\r\nThese healthy, tasty, nutritious, high protein, customized meals are good for everyone with high protein requirement.', 1, 0, '2022-10-06 06:32:17', '2023-01-06 14:12:33'),
(6, 'Gluten Free', 'media/images/goal/1672986150glutanfree.png', 'Gluten free meals are specially designed for people with gluten allergies. The intolerance to the protein called gluten leads to different body discomforts. \r\nThese meals are prepared using millets, oats, buck wheat, gluten free breads, dal Chillas and other options which are gluten free.\r\n\r\nThese healthy prepared meals are also designed keeping in to account the protein content and healthier sources of carbohydrates and fats.\r\n\r\nGluten free meals are tasty, healthy and apt for glucose intolerant people.', 1, 0, '2022-10-06 06:32:28', '2023-01-06 14:13:16');
