(68, 3, 'Update', 'updateGoal', '{\"id\":1,\"name\":\"Weight Loss\",\"image\":\"media\\/images\\/goal\\/1672986079weightloss.png\",\"description\":\"Weight loss meal delivery at your doorstep. \\r\\nFIBRE RICH, NUTRITIOUS, LOW CALORIE, HIGH PROTEIN MEALS\\r\\n\\r\\nIf losing weight is your goal we can help you achieve that with our weight loss meals. These combos are just right in terms of Macronutrients and Micronutrients. \\r\\n\\r\\nA typical Indian diet has majorly simple carbs and sugars in the platter leading to the problem of weight gain.\\r\\n\\r\\nThese healthy meal combos constitute of low complex carbs, high proteins and low fat. We curate meals and display all the calorie values so that you can make informed decision about what and how much to eat.\\r\\n\\r\\nThese combos are high protein meals, which keep you full for a long time and lead to a healthier and stronger version of yourself. High protein vegetarian meals as well as high protein non-veg meal delivery services available with daily meal subscriptions. \\r\\n\\r\\nIn-short the meals are High in protein, low in carbs, have good fat loaded with seeds and served with in-house prepared sauces.\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2022-10-05T23:31:14.000000Z\",\"updated_at\":\"2023-01-06T07:10:57.000000Z\"}', '110.226.182.176', '2023-01-06 14:10:57', '2023-01-06 14:10:57'),
(69, 3, 'Update', 'updateGoal', '{\"id\":2,\"name\":\"Diabetic Friendly\",\"image\":\"media\\/images\\/goal\\/1672986096sugarfree.png\",\"description\":\"HIGH FIBRE, LOW GI, NON-SUGARY, NUTRITIOUS, HIGH PROTEIN MEALS\\r\\n\\r\\nThese healthy meal combos help in controlling sugar levels, these meals can also be customized after booking an appointment with our diet consultant. These meals help in controlling sugar levels and help you achieve your health goals.\\r\\n\\r\\nOrder diet food online and our customers have responded very well to these specially curated meals.\\r\\nDiabetic meals consist of low GI foods, complex carbs, good fats, high fiber, and high protein meals.\\r\\n \\r\\nThese curated meals help in controlling sugar levels. The combos are calorie counted and keep macros in check.\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2022-10-05T23:31:31.000000Z\",\"updated_at\":\"2023-01-06T07:11:46.000000Z\"}', '110.226.182.176', '2023-01-06 14:11:46', '2023-01-06 14:11:46'),
(70, 3, 'Update', 'updateGoal', '{\"id\":4,\"name\":\"PCOD Friendly\",\"image\":\"media\\/images\\/goal\\/1672986131pcodfriendly.png\",\"description\":\"These healthy customized meals are PCOD friendly as they are macro and micro counted high protein combos with meals specially designed to take care of women suffering with PCOD. \\r\\n\\r\\nLot of women today is suffering from PCOD so it\\u2019s important to address this issue with corrective meals.\\r\\n\\r\\nFor further customization book an appointment with our in-house dietitians and live a healthy life with healthy meal subscriptions.\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2022-10-05T23:32:03.000000Z\",\"updated_at\":\"2023-01-06T07:12:11.000000Z\"}', '110.226.182.176', '2023-01-06 14:12:11', '2023-01-06 14:12:11'),
(71, 3, 'Update', 'updateGoal', '{\"id\":5,\"name\":\"Muscle Building\",\"image\":\"media\\/images\\/goal\\/1672986142musclebuilding.png\",\"description\":\"These meals are helpful in bulking up muscles while reducing body\\u2019s fat percentage.\\r\\n\\r\\nThe meals are high in protein and sports persons and body builders curate combos considering high requirement of proteins. \\r\\n\\r\\nThe meals are very helpful in building body muscles, toning the body and make you feel better and stronger. Order diet food online for your daily diet routine just at your doorstep.\\r\\n\\r\\nThese healthy, tasty, nutritious, high protein, customized meals are good for everyone with high protein requirement.\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2022-10-05T23:32:17.000000Z\",\"updated_at\":\"2023-01-06T07:12:33.000000Z\"}', '110.226.182.176', '2023-01-06 14:12:33', '2023-01-06 14:12:33'),
(72, 3, 'Update', 'updateGoal', '{\"id\":6,\"name\":\"Gluten Free\",\"image\":\"media\\/images\\/goal\\/1672986150glutanfree.png\",\"description\":\"Gluten free meals are specially designed for people with gluten allergies. The intolerance to the protein called gluten leads to different body discomforts. \\r\\nThese meals are prepared using millets, oats, buck wheat, gluten free breads, dal Chillas and other options which are gluten free.\\r\\n\\r\\nThese healthy prepared meals are also designed keeping in to account the protein content and healthier sources of carbohydrates and fats.\\r\\n\\r\\nGluten free meals are tasty, healthy and apt for glucose intolerant people.\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2022-10-05T23:32:28.000000Z\",\"updated_at\":\"2023-01-06T07:13:16.000000Z\"}', '110.226.182.176', '2023-01-06 14:13:16', '2023-01-06 14:13:16'),
(73, 3, 'Update', 'updateGoal', '{\"id\":3,\"name\":\"Indian Balanced Meal\",\"image\":\"media\\/images\\/goal\\/1672986119nalanced.png\",\"description\":\"These meals are Indian meals, and both veg and non-veg options are available. The meals are balanced with carbs, fats and proteins.\\r\\n\\r\\nThese Indian meals are simple homemade meals \\r\\n\\r\\nThe healthy meals prepared have low oil, medium spicy, very simple, homemade, tasty and healthy meals.\\r\\nThe menu for these meals is prepared for the month and displayed on the website. You can also have healthy meal subscription or healthy Tiffin services for a month where the healthy meals are delivered at your doorsteps daily.\\r\\n\\r\\nMostly the menu remains as pre-decided, but it is subject to change due to unavoidable circumstances.\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2022-10-05T23:31:47.000000Z\",\"updated_at\":\"2023-01-06T07:14:08.000000Z\"}', '110.226.182.176', '2023-01-06 14:14:08', '2023-01-06 14:14:08'),
