(79, 5, 'Update', 'updateTestimonial', '{\"id\":5,\"media\":\"media\\/images\\/testimonials\\/1673070005mona b.JPG\",\"type\":\"image\",\"name\":\"Ipsita B\",\"comment\":\"I am from the IT Industry and my work schedule makes it really difficult to make meals for me let alone coming up with nutritious choices. In addition to that Food Grade Packaging is where my food comes from every single day; in these times of the Pandemic it is essential to maintain absolute food safety.\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2022-12-12T08:16:45.000000Z\",\"updated_at\":\"2023-01-07T05:40:05.000000Z\"}', '103.203.147.134', '2023-01-07 12:40:05', '2023-01-07 12:40:05'),
(80, 5, 'Update', 'updateTestimonial', '{\"id\":3,\"media\":\"media\\/images\\/testimonials\\/1673070030ispita.JPG\",\"type\":\"image\",\"name\":\"Mona  Bhattacharya\",\"comment\":\"Poonam takes utmost care to go through your medical history and understand what will best work for you. For instance, I have a history of Irritable Bowel Syndrome and she supplemented my meals with Pre and Probiotics helping my condition stabilize She also helped me understand what kind of supplements I should take that would help make my condition better.\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2022-12-12T08:13:39.000000Z\",\"updated_at\":\"2023-01-07T05:40:30.000000Z\"}', '103.203.147.134', '2023-01-07 12:40:30', '2023-01-07 12:40:30'),
(81, 5, 'Update', 'updateTestimonial', '{\"id\":2,\"media\":null,\"type\":\"image\",\"name\":\"Kamna Desai\",\"comment\":\"I am a practising dietitian with almost 2 decades of\\r\\nonline and offline practice in Mumbai. Whenever\\r\\nany of my clients face any issues with respect to\\r\\nordering food as per the meal planned by me,\\r\\nPoonam Kapur\'s Healthy Kitchen is my go to. She\\r\\ndelivers customised prescription based Veg, Nonveg, Indian, Continental, Vegan, Gluten-free, Raw\\r\\nand Keto meals with very good options. These\\r\\nsubscription meals are healthy, nourishing and\\r\\ncalorie counted to fit my client requirements. Highly\\r\\nrecommend her meal & services.\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2022-12-12T08:11:48.000000Z\",\"updated_at\":\"2023-01-07T05:51:48.000000Z\"}', '103.203.147.134', '2023-01-07 12:51:48', '2023-01-07 12:51:48'),
(82, 5, 'Update', 'updateTestimonial', '{\"id\":2,\"media\":\"media\\/images\\/testimonials\\/1673070728kamna.JPG\",\"type\":\"image\",\"name\":\"Kamna Desai\",\"comment\":\"I am a practising dietitian with almost 2 decades of\\r\\nonline and offline practice in Mumbai. Whenever\\r\\nany of my clients face any issues with respect to\\r\\nordering food as per the meal planned by me,\\r\\nPoonam Kapur\'s Healthy Kitchen is my go to. She\\r\\ndelivers customised prescription based Veg, Nonveg, Indian, Continental, Vegan, Gluten-free, Raw\\r\\nand Keto meals with very good options. These\\r\\nsubscription meals are healthy, nourishing and\\r\\ncalorie counted to fit my client requirements. Highly\\r\\nrecommend her meal & services.\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2022-12-12T08:11:48.000000Z\",\"updated_at\":\"2023-01-07T05:52:08.000000Z\"}', '103.203.147.134', '2023-01-07 12:52:08', '2023-01-07 12:52:08'),
