(90, 5, 'Update', 'updateTestimonial', '{\"id\":9,\"media\":\"media\\/images\\/testimonials\\/1673074526Suhasini.JPG\",\"type\":\"image\",\"name\":\"Suhasini Mulay\",\"comment\":\"Meals are healthy and nutritious. \\r\\nWe have been having meals from Poonam from quite long\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2023-01-07T06:55:03.000000Z\",\"updated_at\":\"2023-01-07T06:55:26.000000Z\"}', '103.203.147.134', '2023-01-07 13:55:26', '2023-01-07 13:55:26'),
(91, 5, 'Add', 'storeTestimonial', '{\"type\":\"image\",\"name\":\"Sushma Lakdawala\",\"comment\":\"We really love ordering food from Poonam. We have been having juices regularly from her. The juices served are fresh and have helped us with positive health.\",\"media\":\"media\\/images\\/testimonials\\/1673074630WhatsApp Image 2023-01-07 at 10.13.35 (1).jpeg\",\"status\":\"1\",\"updated_at\":\"2023-01-07T06:57:10.000000Z\",\"created_at\":\"2023-01-07T06:57:10.000000Z\",\"id\":10}', '103.203.147.134', '2023-01-07 13:57:10', '2023-01-07 13:57:10'),
(92, 5, 'Login', 'Login', '5', '110.226.180.244', '2023-01-09 11:47:02', '2023-01-09 11:47:02'),
(93, 5, 'Update', 'updateTestimonial', '{\"id\":3,\"media\":\"media\\/images\\/testimonials\\/1673070030ispita.JPG\",\"type\":\"image\",\"name\":\"Suhasini Mulay\",\"comment\":\"Poonam takes utmost care to go through your medical history and understand what will best work for you. For instance, I have a history of Irritable Bowel Syndrome and she supplemented my meals with Pre and Probiotics helping my condition stabilize She also helped me understand what kind of supplements I should take that would help make my condition better.\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2022-12-12T08:13:39.000000Z\",\"updated_at\":\"2023-01-09T04:49:28.000000Z\"}', '110.226.180.244', '2023-01-09 11:49:28', '2023-01-09 11:49:28'),
(94, 5, 'Update', 'updateTestimonial', '{\"id\":9,\"media\":\"media\\/images\\/testimonials\\/1673074526Suhasini.JPG\",\"type\":\"image\",\"name\":\"Mona  Bhattacharya\",\"comment\":\"Poonam takes utmost care to go through your medical history and understand what will best work for you. For instance, I have a history of Irritable Bowel Syndrome and she supplemented my meals with Pre and Probiotics helping my condition stabilize She also helped me understand what kind of supplements I should take that would help make my condition better.\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2023-01-07T06:55:03.000000Z\",\"updated_at\":\"2023-01-09T04:51:36.000000Z\"}', '110.226.180.244', '2023-01-09 11:51:36', '2023-01-09 11:51:36'),
(95, 5, 'Update', 'updateTestimonial', '{\"id\":3,\"media\":\"media\\/images\\/testimonials\\/1673239981Suhasini.JPG\",\"type\":\"image\",\"name\":\"Suhasini Mulay\",\"comment\":\"Meals are healthy and nutritious. We have been having meals from Poonam from quite long\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2022-12-12T08:13:39.000000Z\",\"updated_at\":\"2023-01-09T04:53:01.000000Z\"}', '110.226.180.244', '2023-01-09 11:53:01', '2023-01-09 11:53:01'),
(96, 5, 'Update', 'updateTestimonial', '{\"id\":9,\"media\":\"media\\/images\\/testimonials\\/1673240002ispita.JPG\",\"type\":\"image\",\"name\":\"Mona  Bhattacharya\",\"comment\":\"Poonam takes utmost care to go through your medical history and understand what will best work for you. For instance, I have a history of Irritable Bowel Syndrome and she supplemented my meals with Pre and Probiotics helping my condition stabilize She also helped me understand what kind of supplements I should take that would help make my condition better.\",\"status\":\"1\",\"deleteId\":\"0\",\"created_at\":\"2023-01-07T06:55:03.000000Z\",\"updated_at\":\"2023-01-09T04:53:22.000000Z\"}', '110.226.180.244', '2023-01-09 11:53:22', '2023-01-09 11:53:22'),
