INSERT INTO `testimonials` (`id`, `media`, `type`, `name`, `comment`, `status`, `deleteId`, `created_at`, `updated_at`) VALUES
(1, 'media/images/testimonials/167069466207.png', 'image', 'Rahul Mehta', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since', 1, 1, '2022-12-10 12:21:02', '2022-12-12 15:13:47'),
(2, 'media/images/testimonials/1673070728kamna.JPG', 'image', 'Kamna Desai', 'I am a practising dietitian with almost 2 decades of\r\nonline and offline practice in Mumbai. Whenever\r\nany of my clients face any issues with respect to\r\nordering food as per the meal planned by me,\r\nPoonam Kapur\'s Healthy Kitchen is my go to. She\r\ndelivers customised prescription based Veg, Nonveg, Indian, Continental, Vegan, Gluten-free, Raw\r\nand Keto meals with very good options. These\r\nsubscription meals are healthy, nourishing and\r\ncalorie counted to fit my client requirements. Highly\r\nrecommend her meal & services.', 1, 0, '2022-12-12 15:11:48', '2023-01-07 12:52:08'),
(3, 'media/images/testimonials/1673239981Suhasini.JPG', 'image', 'Suhasini Mulay', 'Meals are healthy and nutritious. We have been having meals from Poonam from quite long', 1, 0, '2022-12-12 15:13:39', '2023-01-09 11:53:01'),
(4, 'media/images/testimonials/1673070862WhatsApp Image 2023-01-07 at 10.13.35.jpeg', 'image', 'Shashi Sharma', 'Poonam Kapur is a well Known name in health Food industry. I personally love her healthy protein rich  meals. \r\nI will recommend these curated meals to all health conscious people in their journey of achieving individual health goals.', 1, 0, '2022-12-12 15:15:40', '2023-01-07 12:54:22'),
(5, 'media/images/testimonials/1673070005mona b.JPG', 'image', 'Ipsita B', 'I am from the IT Industry and my work schedule makes it really difficult to make meals for me let alone coming up with nutritious choices. In addition to that Food Grade Packaging is where my food comes from every single day; in these times of the Pandemic it is essential to maintain absolute food safety.', 1, 0, '2022-12-12 15:16:45', '2023-01-07 12:40:05'),
(6, 'media/images/testimonials/1673071258WhatsApp Image 2023-01-07 at 10.13.34.jpeg', 'image', 'Jagpreet Kaur', 'It was great experience ordering food from poonam kapur\'s kitchen. We ordered food for our whole staff in office and everyone loved the delicious food made by her. Thank You Poonam Ji for the amazing food.', 1, 0, '2023-01-07 13:00:58', '2023-01-07 13:00:58'),
(7, 'media/images/testimonials/1673071832WhatsApp Image 2023-01-07 at 10.13.34 (1).jpeg', 'image', 'Deven Malkan', 'Certainly, not a run of the mill tiffin service. Poonam Kapur\'s  food is not only tasty but also  hygenic and healthy. I am sold to her for high quality of ingredients she uses and the and the proper quantity of spices she adds to make her fodd very very delicious. Let me admit ghar ka khana (home food) is not better than what she cooks.', 1, 0, '2023-01-07 13:10:32', '2023-01-07 13:10:32'),
(8, 'media/images/testimonials/1673074314jitin.JPG', 'image', 'Jitin Babu', 'There is a big gap in the market where we are told what to eat, but no one is there to prepare what we are \r\nsuppose to eat And You have filled that gap pretty well\r\nWrap was very yummy and healthy, i never thought healthy food could be so yummy 😍', 1, 0, '2023-01-07 13:51:01', '2023-01-07 13:51:54'),
(9, 'media/images/testimonials/1673240002ispita.JPG', 'image', 'Mona  Bhattacharya', 'Poonam takes utmost care to go through your medical history and understand what will best work for you. For instance, I have a history of Irritable Bowel Syndrome and she supplemented my meals with Pre and Probiotics helping my condition stabilize She also helped me understand what kind of supplements I should take that would help make my condition better.', 1, 0, '2023-01-07 13:55:03', '2023-01-09 11:53:22'),
(10, 'media/images/testimonials/1673074630WhatsApp Image 2023-01-07 at 10.13.35 (1).jpeg', 'image', 'Sushma Lakdawala', 'We really love ordering food from Poonam. We have been having juices regularly from her. The juices served are fresh and have helped us with positive health.', 1, 0, '2023-01-07 13:57:10', '2023-01-07 13:57:10');
